import React from 'react';
import CardContent from '@material-ui/core/CardContent';
import styles from './Contacts.module.css'; 
import email from './img/email.png';
import github from './img/github.png';
import facebook from './img/facebook.png';
import instagram from './img/instagram.png';

const Contacts = () => (
	// <CardContent>
	// 	<h1>Contacts</h1>
	// </CardContent>
	<div>
		<div className={styles.contacts}>
			<p className={styles.email}>
				<img src={email} alt="email" className={styles.email_img}></img>
				<a href="mailto:kaba100@yandex.ru" className={styles.email}>kaba100@yandex.ru</a>
			</p>
		</div>
		<div>
			<a href="https://github.com/SanSanKon" className={styles.socialnetwork}><img src={github} alt="github" className={styles.socialnetwork_img}></img></a>
			<a href="https://www.instagram.com/alex_beard18287/" className={styles.socialnetwork}><img src={instagram} alt="instagram" className={styles.socialnetwork_img}></img></a>
			<a href="https://web.facebook.com/nadezhda.cheplagina" className={styles.social}><img src={facebook} alt="facebook" className={styles.social_img}></img></a>
		</div>
	</div>
);

export default Contacts;
